import React, { Component } from "react";

import styled from 'styled-components'

export default class NavBar extends Component {
    render() {
        return (
            <div>
                <nav className="navbar navbar-expand-md navbar-dark bg-dark fixed-top">
                    <a className='navbar-brand col-sm-3 col-md-2 mr-0 align-items-center'>Emsig</a>
                    <nav className="nav navbar-expand-md navbar-dark bg-dark fixed-top">
                    <lable for='cardNum'>Card Number</lable><input className='cardNum'></input>
                    <lable for='Pattern'>Pattern</lable><input className='Pattern'></input>
                </nav>
                </nav>
                
            </div>
        )
    }
}
